import Card from "./Card";
import axios from "axios";
import { Link, useLocation } from "react-router-dom";
import Series from "./Series";
import Movies from "./Movies";

const Home = () => {
    const [imgsArr, setImg] = useState([]);
    useEffect(() => {
        async function getData() {
            const response = await axios.get(
                "https://api.themoviedb.org/3/movie/popular/?api_key=692ad17fefe3f279a5bc0dfa87752845"
            );
            const moviesArr = response.data.results;
            setImg(moviesArr);
            console.log(imgsArr);
        }
        getData();
    }, []);

    return (
        <div className="container mt-5 ">
            <h2 className="text-light mb-5 mt-5">Trending Tv Shows </h2>
            <Series className="mt-5"></Series>
            <div className="m-5">{""}</div>
            <Movies className="mt-5"></Movies>
        </div>
    );
};

export default Home;
